import React from "react";
import "./assets/css/App.css";
import DashBoard from "./components/Dashboard";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      tweets: [],
      isLoaded: false,
    };
  }

  componentDidMount() {
    fetch("http://localhost:5000/sentiment/rona")
      .then((res) => res.json())
      .then((data) => {
        this.setState({
          tweets: data,
          isLoaded: true,
        });
        console.log(this.state.tweets);
      });
  }

  render() {
    return (
      <div>
        <DashBoard tweets={this.state.tweets}></DashBoard>
      </div>
    );
  }
}

export default App;
